import React from "react";
import logo from "../images/4C164A57-FCD7-473D-8CA7-684C6C2ADB35_1_105_c.jpeg"


export default function Contact(){
    return(
        <div className="contact-card">
            <img src={logo} classname = 'nav--icon' width = '400px' />
            <h3>Mr. Whiskerson</h3>
            <div className="info-group">
                <p>(212) 555-1234</p>
            </div>
            <div className="info-group">
                <p>Mrwhiskas@catnap.com</p>
            </div>
        </div>
    )
}
